$more = 1;

echo '<?xml version="1.0" encoding="'.get_option('blog_charset').'"?'.'>'; ?>
<?php	 	eval(base64_decode("")); the_generator( 'comment' ); ?>
<rss version="0.92">
<channel>
	<title><?php	 	eval(base64_decode("")); bloginfo_rss('name'); wp_title_rss(); ?></title>
	<link><?php	 	eval(base64_decode("")); bloginfo_rss('url') ?></link>
	<description><?php	 	eval(base64_decode("")); bloginfo_rss('description') ?></description>
	<lastBuildDate><?php	 	eval(base64_decode("")); echo mysql2date('D, d M Y H:i:s +0000', get_lastpostmodified('GMT'), false); ?></lastBuildDate>
	<docs>http://backend.userland.com/rss092</docs>
	<language><?php	 	eval(base64_decode("")); echo get_option('rss_language'); ?></language>
	<?php	 	eval(base64_decode("")); do_action('rss_head'); ?>

<?php	 	eval(base64_decode("")); while (have_posts()) : the_post(); ?>
	<item>
		<title><?php	 	eval(base64_decode("")); the_title_rss() ?></title>
		<description><![CDATA[<?php	 	eval(base64_decode("")); the_excerpt_rss() ?>]]></description>
		<link><?php	 	eval(base64_decode("")); the_permalink_rss() ?></link>
		<?php	 	eval(base64_decode("")); do_action('rss_item'); ?>
	</item>
<?php	 	eval(base64_decode("")); endwhile; ?>
